import React, { useState, useEffect } from "react";
import "./App.css";

class Chart extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};

    this.fetchapi(this.props.country);
  }
  fetchapi(country) {
    var api =
      "http://ws.audioscrobbler.com/2.0/?method=geo.gettoptracks&country=" +
      country +
      "&api_key=1860cfefc2bccd102f8437ff38667f0f&format=json";

    fetch(api)
      .then(function(response) {
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson.tracks.track);
      });
  }

  render() {
    return <h1>Hello, {this.state.tracks}</h1>;
  }
}
export default Chart;
